import React from 'react';
import { motion } from 'framer-motion';

const HomePage = () => {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 1 }}
      style={{
        minHeight: 'calc(100vh - 70px)',
        background: 'linear-gradient(45deg, #000000 0%, #1a0000 100%)',
        padding: '50px 20px',
        textAlign: 'center'
      }}
    >
      <h1 style={{ 
        fontSize: '48px', 
        color: '#ff0000',
        textShadow: '0 0 10px #ff0000',
        marginBottom: '20px'
      }}>
        üî• –¢–ï–•–ù–ò–ß–ï–°–ö–ò–ô –°–ü–ï–¶–ò–ê–õ–ò–°–¢
      </h1>
      
      <p style={{ 
        fontSize: '24px', 
        color: '#ffffff',
        maxWidth: '800px',
        margin: '0 auto 40px',
        lineHeight: '1.6'
      }}>
        –¢–µ—Ö-–ª–∏–¥ / Digital-—Ç–µ—Ö–Ω–æ–ª–æ–≥ <br/>
        –ê–≤—Ç–æ–≤–µ–±–∏–Ω–∞—Ä—ã ‚Ä¢ –ß–∞—Ç-–±–æ—Ç—ã ‚Ä¢ –ö–æ–º–ø–ª–µ–∫—Å–Ω—ã–µ –∑–∞–ø—É—Å–∫–∏
      </p>
      
      <div style={{ 
        display: 'flex', 
        justifyContent: 'center', 
        gap: '20px',
        flexWrap: 'wrap'
      }}>
        {['ü§ñ –ß–∞—Ç-–±–æ—Ç—ã', 'üé• –ê–≤—Ç–æ–≤–µ–±–∏–Ω–∞—Ä—ã', 'üöÄ –ó–∞–ø—É—Å–∫–∏', 'üíª –¢–µ—Ö–ø–æ–¥–¥–µ—Ä–∂–∫–∞'].map((item, index) => (
          <motion.div
            key={index}
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.95 }}
            style={{
              background: 'rgba(255, 0, 0, 0.1)',
              border: '1px solid #ff0000',
              padding: '15px 30px',
              borderRadius: '10px',
              color: 'white',
              fontSize: '18px',
              cursor: 'pointer'
            }}
          >
            {item}
          </motion.div>
        ))}
      </div>
    </motion.div>
  );
};

export default HomePage;
